import React from 'react';
import { Routes, Route } from "react-router-dom";
import "./App.css"
import Home from "./Home";
import Contact from "./Contact";
import Navbar from './Navbar';

function App() {
  return (
    <Routes>
      <Route path="/" elements={<Home />} />
      <Route path="/contact" elements={<Contact />} />
    </Routes>
  );
}

export default App;
